import React, { useContext, useState } from "react";

import { userprofilecontext } from "../../Allcontexts/Getloggedinuser";

function Profile() {
  // userprofile context
  const { userprofile } = useContext(userprofilecontext);
  return (
    <>
      <section>
        <div>
          <img className="user-bg-template" src="" alt="" />
          {
               userprofile.map((profile , i)=>(
                    <div className="mapped-profiledata-div">
                         <img src="" alt="" />
                    </div>
               ))
          }
        </div>
      </section>
    </>
  );
}

export default Profile;
